import React, { Component } from "react";
import { addRessource } from "../../actions";
import getIntegerList from "../../selectors";
import { connect } from "react-redux";

class Ressources extends Component {
  renderRessources = ressources => {
    return ressources.map(ressource => <li>{ressource}</li>);
  };

  render() {
    return (
      <div>
        <div className="row">
          <div className="col">
            <button
              type="button"
              onClick={() => this.props.addRessource()}
              className="btn btn-raised btn-primary"
            >
              Ajouter un nombre
            </button>
          </div>
        </div>
        <div className="row">
          <div className="col">
            {" "}
            Entiers{" "}
            <ul>{this.renderRessources(this.props.integerRessources)}</ul>
          </div>
          <div className="col"> Contiennent 1 </div>
          <div className="col"> Entier premiers </div>
          <div className="col"> Entier premiers contenant 1 </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    integerRessources: getIntegerList()
  };
};

const mapDispatchToProps = {
  addRessource
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Ressources);
